import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';
import Button from "./components/"

import Footer from '../src/components/Footer';

function App() {
  return (
    <div className="App">
      <img src="https://img.icons8.com/nolan/64/video-playlist.png" alt="logo"/>
      <div className="titles">
        <h1>
          Player<br />Video
        </h1>
        <h2>
          To Upload. To compress. To view video files.
        </h2>
      </div>

      {/* <Footer /> */}
      <footer className="footer">
            <Link to="contact"><p className="footer-contact-text">Presented by <span><a href="https://github.com/SYB-SFLA">Sophie BAYRAM</a></span></p></Link>
        </footer>
    </div>
  );
}

export default App;
